    "mafia_help_text": "Вражеские шпионы наводнили наши стратегически важные города!\nУчаствуйте в схватках с другими игроками, принесите пользу своей команде. Группа граждан должна вычислить и арестовать всех шпионов. Задача шпионов - оставить в игре столько же граждан, сколько и самих шпионов, посеяв хаос в городе. Некоторые игроки занимают особые роли - Главаря, Комиссара или Доктора, и получают уникальные способности.\nЗа каждую победу вашей команды вы получите сейф с предметами, деталями и ресурсами. Также за каждую игру накапливается опыт, за повышение уровня вы также будете получать сейфы.\nВо время схватки вам пригодятся особые предметы, которые можно найти среди наград, или купить в магазине. Лучшие игроки будут отмечены дополнительными наградами ежедневно, и по завершении события.\nПерехитрите противника и принесите пользу своей команде! Найдите все детали и получите легендарную \"Эмку\" ГАЗ М-1! Удачи!",
